fn are_different_by_one_char(first :&str, second :&str) -> bool {
    if &first.len() != &second.len() {
        return false;
    }
    let mut differences = 0;
    for (x, y) in first.chars().zip(second.chars()) {
        if x != y {
            differences += 1;
        }
    }
    if differences == 1 {
        return true;
    }    
    false
}

fn get_common_chars(first :&str, second :&str) -> String {
    let mut common_chars = String::from("");
    
    for (x, y) in first.chars().zip(second.chars()) {
        if x == y {
            common_chars.push(x);
        }
    }
    common_chars
}
